import React, { useState, useEffect } from 'react';
import UserService from '../services/UserService';
import { useNavigate } from 'react-router-dom';

const ViewUserComponent = (props) => {
    const buttonStyle = {
        padding: '10px 20px',
        fontSize: '16px',
        backgroundColor: '#3498db', // Blue color
        color: '#fff', // White text
        borderRadius: '5px',
        border: 'none',
        cursor: 'pointer',
      };

    const navigate = useNavigate();
    const [task, setTask] = useState({
    id: "",
  });



  const addTask = () => {
    navigate('/add-list');
  };

  const viewTask = () => {
    navigate(`/list/all`);
  };

  useEffect(() => {
    UserService.getAllTasks(props.id).then((res) => {
      setTask(res.data);
    });
  }, [props.id]);

  return (
    <div>
      <div className="row">
        <button style={buttonStyle} onClick={addTask}>
          Add Task
        </button>
      </div>
      <div>
      <button style={buttonStyle} onClick={viewTask}>
        ViewAllTask</button>
      </div>
    </div>
  );
};

export default ViewUserComponent;
